import { Component } from "react";
import React from 'react';
import EditTable from 'material-editable-table';
class Tables extends Component{

     headers = [
        {value: 'Name', type: 'TextField', width: 200},
        {value: 'Address', type: 'TextField', width: 200},
        {value: 'Phone', type: 'TextField', width: 200},
        {value: 'Date', type: 'DatePicker', width: 200},
        {value: 'Enabled', type: 'Toggle', width: 50},
        {value: 'Last Edited By', type: 'ReadOnly', width: 100}
      ]
      
       rows = [
        {columns: [
          {value: 'Michael'},
          {value: '1212 Somewhere st.'},
          {value: '555-1212'},
          {value: new Date()},
          {value: false},
          {value: 'Michael at 4:20pm'}
        ]},
        {columns: [
          {value: 'Sara'},
          {value: '1212 Somewhere st.'},
          {value: '555-1212'},
          {value: new Date()},
          {value: true},
          {value: 'Someone at 5:50pm'}
        ]},
        {columns: [
          {value: 'Randy Randerson'},
          {value: '5555 Somewhere st.'},
          {value: '888-555-3333'},
          {value: new Date()},
          {value: true},
          {value: 'Randy at 3:33pm'}
        ]}
      ]
      
       onChange = (row) => {
        console.log(row)
      }
      
       onDelete = (e) => {
        console.log(e)
      }
      
        
      
      render(){
     
  
    
        return ( 
            <React.Fragment>
            <EditTable
              onChange={this.onChange}
              onDelete={this.onDelete}
              rows={this.rows}
              headerColumns={this.headers}
              enableDelete={Boolean(true)}
            /></React.Fragment>
          )
        }
      }
    

export default Tables;
